import React, { useState, useEffect } from 'react';
import io from 'socket.io-client';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import './Chat.css';

const SERVER_IP = 'http://127.0.0.1:4000';
const socket = io(SERVER_IP);

const getDate = function () {
    const date = new Date();
    const hours = date.getHours();
    const minutes = date.getMinutes();
    const fomattedTime = `${hours}:${minutes < 10 ? '0' : ''}${minutes}`;
    return fomattedTime;
};

const Chat = () => {
    const [msg, setMsg] = useState('');
    const [file, setFile] = useState(null);
    const [chat, setChat] = useState([]);
    const [nickname, setNickname] = useState('');
    const navigate = useNavigate();

    useEffect(() => {
        const storedUserName = localStorage.getItem('username') || 'Guest';
        setNickname(storedUserName);

        const fetchChatHistory = async () => {
            try {
                const response = await axios.get(`${SERVER_IP}/chat-history`);
                setChat(response.data);
            } catch (err) {
                console.error('Error fetching chat history:', err);
            }
        };

        fetchChatHistory();

        socket.on('msg', (myData) => {
            setChat((prevChat) => [...prevChat, myData]);
        });

        return () => {
            socket.off('msg');
        };
    }, []);

    const send = (e) => {
        e.preventDefault();
        if (msg.trim() === '') return;
        const messageData = { userName: nickname, msg, sender: true, date_time: getDate() };
        socket.emit('msg', messageData);
        setMsg('');
    };

    const handleFileChange = (e) => {
        setFile(e.target.files[0]);
    };

    const uploadFile = (e) => {
        e.preventDefault();
        if (!file) {
            alert('Please select a file to upload');
            return;
        }
        const formData = new FormData();
        formData.append('file', file);
        axios.post(`${SERVER_IP}/upload`, formData).then(response => {
            const { fileName, filePath } = response.data;
            socket.emit('file-upload', { userName: nickname, fileName, filePath });
            setFile(null);
        }).catch(err => {
            console.error('Error uploading file:', err);
        });
    };

    const handleLogout = () => {
        localStorage.removeItem('username');
        navigate('/login');
    };

    const updateNickname = () => {
        const newNickname = prompt('Enter your new nickname:', nickname);
        if (newNickname) setNickname(newNickname);
    };

    return (
        <div className="App">
            <div className="header">
                <div className="nickname-section">
                    Nickname: <button onClick={updateNickname} className="nickname-edit">{nickname}</button>
                </div>
                <button onClick={handleLogout} className="logout-button">Log out</button>
            </div>
            <div className='contain'>
                <div className='contain-main'>
                    <div className="chatMsg">
                        {chat.map((myData, index) => (
                            <div key={index} className={myData.sender ? 'sender' : 'receiver'}>
                                <strong className='chat-strong'>{myData.userName}</strong>
                                <div className='chat-send-p'>{myData.msg}</div>
                                <div className='time'>{myData.date_time}</div>
                            </div>
                        ))}
                    </div>
                    <form onSubmit={send} className='chat-form'>
                        <input
                            type="text"
                            placeholder="Type your message here"
                            value={msg}
                            onChange={(e) => setMsg(e.target.value)}
                            required
                            className='chat-input'
                        />
                        <input
                            type="file"
                            id="fileInput"
                            onChange={handleFileChange}
                            className='chat-file'
                        />
                        <label htmlFor="fileInput" className="file-label">File</label>
                        <button type="submit" className='chat-send'>Send</button>
                    </form>
                </div>
            </div>
        </div>
    );
};

export default Chat;
